import { useState } from "react"
import Foodlist from "./Foodlist";

const Home = ()=>{
    let [items, setItems] = useState([
        {foodName:"Chicken Biryani", Price:300, type:"Non-Veg", Rating:9, pic:"data:image/jpeg;base64,"},
        {foodName:"Mutton Curry", Price:400, type:"Non-Veg", Rating:9, pic:"data:image/jpeg;base64,"},
        {foodName:"Idli", Price:50, type:"Veg", Rating:9, pic:"data:image/jpeg;base64,"},
        {foodName:"Dosa", Price:60, type:"Veg", Rating:9, pic:"data:image/jpeg;base64,"},
        {foodName:"Sheekh Kabab", Price:500, type:"Non-Veg", Rating:9, pic:"data:image/jpeg;base64,"}
    ])

    return (
        <div className="home">
        <Foodlist items={items} title="All Food" />
        </div>
    );
}

export default Home;
